      re = re.$mount().$el

      return new L.DivIcon({
        html: re.outerHTML,
        className: 'bg-none'
      })
    },
    walesOptions() {
      return {
        fillColor: 'green',
        fillOpacity: 0.1,
        color: 'black'
      }
    },
    walesPolygon() {
      const wkt = new Wkt.Wkt()
      let json = null

      try {
        wkt.read(this.walesWKT)
